          <Toolbar>
            <IconButton className={classes.menuButton} color="inherit" aria-label="Menu">
                <MenuIcon />
            </IconButton>
            <Typography variant="h6" className={classes.title}>Shin-Nosuke Iino</Typography>
            <div><i class="fa fa-github fa-2x" aria-hidden="true"></i></div>
          </Toolbar>
        </AppBar>
